// 自定义方法
var $m={
    // 字体设置
    rs: function(){
        var limit=720;
        var dw=document.documentElement.clientWidth;
        var dh=document.documentElement.clientHeight;
        var fw=dw>limit?limit:dw;
        $("body").css({"font-size":1*fw/360+"em"});
        var ratio=1;
        if(dh/fw*720<1136){
            ratio=dh/fw*720/1136;
        }
        // if(dw>limit){
        //     $(".center_box").css({"left":(dw-limit)/2+"px"});
        // };
    },
    // 获取时间
    getNdate:function(){
    	var date=new Date();
    	var y=date.getFullYear();
    	var m=date.getMonth()+1;
    	return y+"-"+m;
    },
    ajax_link:"http://givenchy.weshwx.cn/dior_golden_bc/",
    img_url: "images/",
    has_add: true,
    isIn: true,
    myInfo: null,
	isAdd: true,
	start: 0,
    arr_len: 50,
	data_arr:null,
    isAdd1:false,
    start1: 0,
    arr_len1: 50,
    data_arr1:[],
	toSquare: function(obj,num){
		var ow=obj.width();
		obj.height(ow);
		var val=num?num:50;
		obj.css({"border-radius":val+"%"});
	},
    return_data: {"userid":userid,"datetime":"","type":"","stype":""},
    // 格式化数据
    cuter10: function(str){//Rekey
        str=str.toString();
        var len = str.length, str2 = '', max = Math.floor(len / 3);
        for(var i = 0 ; i < max ; i++){ 
            var s = str.slice(len - 3, len); 
            str = str.substr(0, len - 3);
            if(str.length<1){
                str2 = s;
            }else{
                str2 = (',' + s) + str2; 
            }
            len = str.length; 
            str += str2;
        } 
        
        return str 
    },
    now_top:1,				//当前排行榜
    is_get:true,
    get_now: false,
}
// 请求页面
function toGetData(index){
	$.ajax({
		type: "POST",
		url: $m.ajax_link+"get_user",
		data: {userid:userid,rt_type:3},
		dataType: "json",
		success: function(data){
			var date_str=data["1"][0]["datetime"]?data["1"][0]["datetime"]:"";
			var date_arr=date_str.split("-");
			n_date=date_arr[0]+"-"+date_arr[1]?date_arr[0]+"-"+date_arr[1]:$m.getNdate();
			tit_arr=[
				"BC TOP90榜单揭晓<br>"+n_date,
				"其他组别榜单揭晓<br>"+n_date,
				n_date,
				n_date,
				n_date,
				n_date,
				n_date,
				n_date
			];
			$m.is_get=true;
			if(data && data!=null){
				// 有货
				$m.data_arr=data;
				var ndata=null;
				if(index==0){
					ndata=$m.data_arr[index+1];
					toSetDom($(".p4_list").eq(index),ndata);
				}else if(index==1){
					ndata=$m.data_arr;
					toSetDom1($(".p4_list").eq(index),ndata);
				}else{
					ndata=$m.data_arr[index+5];
					toSetDom($(".p4_list").eq(index),ndata);
				}
                
			}else{
				// 没有啦
                $("#hide_div").children(".att_p1").hide();
                $("#hide_div").children(".att_p3").show();
			}
		},
		error: function(){
			$("#hide_div").children(".att_p1").hide();
            $("#hide_div").children(".att_p2").show();
            // $("#nav>li").eq(index).attr("data-add",2);
		}
	});
}
